65,116390603,116407665,116420452,116422077,116425642,116426540,116428047,116428882,116449517,116465267,116480001,116486333,116492155,116502867,116515812,116529230,116539560,116542683,116556426,116566091]],null,null,null,null,4], undefined , [],  true , undefined , "t.0" , 1 , undefined , undefined , false ); DOCS_warmStartDocumentLoader = KX_kixApp.getWarmStartDocumentLoader(); DOCS_cseBlobArtifactsHolder = KX_kixApp.getCseBlobArtifactsHolder(); DOCS_initialLoadTiming = KX_kixApp.getInitialLoadTiming(); KX_getLatencyStats = function() {return KX_kixApp.getPerformanceManager().getInitialLoadStats();}; KX_resize = function() {KX_kixApp.resize();}; _docs_annotate_getAnnotatedText = function(id) {return KX_kixApp.getAnnotatedText(id);};}KX_startKix(); DOCS_initialLoadTiming.setTime('al'); DOCS_initialLoadTiming.setTime('eac');</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_warmStartDocumentLoader.startLoad( 27749.0 ,'Dnt9whdsvhMOpw', 61.0 , 61.0 ,[61,""], null , null ); var DOCS_modelChunkLoadStart; var DOCS_modelChunkParseStart; var DOCS_modelChunk;</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_modelChunk = {"chunk":[{"ty":"mkch","d":[[1,"Tab 1"]]},{"ty":"utlp","d":[[[],[1,"en"]]]},{"ty":"is","ibi":1,"s":"Serena’s Date-Me Doc\n49 | F/NB | Seattle \n*\n\n\nHi, I’m Serena. I’m looking for my life partner. Also open to interesting connections until I find him. Contact info at the bottom. Thanks for reading and best wishes for your search!\n\nSummary:\nAge: 49 \nGender: Mainly F / a bit NB (AFAB)\nKids: Child-free\nLocation: Seattle, WA, love it here and also open to relocating  \nProfession: Middle manager, HR/Ops, STEM\nSide gig: Energy healer / spiritual coach \nEducation:  BA, MPA\nPolitics: Left-ish\nReligion: None. All. I like science, enlightenment, and magic. \nDiet: Keto\nPets: 2 dogs, love cats but am allergic\nSocial: Introvert, but not shy\nMain languages: English, Spanish, Bikol, some German - plus a teensy bit of Mandarin, Japanese, and Korean\nPsych/physiology: INF/TP, 9w8, neurospicy, psychic, HSS HSP\n\nWhat I’m Looking for in a Partner:\n\nHonest, authentic, has integrity \nOpen-hearted, enjoys life\nMaking the world a better place \nGood with intimacy and relationships\nSome degree of stability, but open to change and growth\nCuriosity about life and learning new things\n\n*\nWith some friends at a tai chi event, 2024.\n\n\n\n\nHobbies: \nTaijiquan:. My favorite hobby is tai chi push hands. It’s like a combination of jedi training, sumo wrestling, and ballroom dancing. Although I’ve competed in tournaments, one of my friends describes my push hands as “utterly without malice, full of love and healing.” I’m more interested in the soft, internal, and collaborative aspects these days. I practice taijiquan for health, self-defense, and because I love the playful movement and game of it.\nMovies/TV: I like smart or clever movies, fantasy, action, romance, and k/j/c-dramas - it’s more fun if I can learn a new language too. I also like watching something interesting together and then talking about it.\nOther Interests: Science, futurism, politics, public policy, interesting projects, painting, poetry, music, singing, dancing, mountains, water, relationships, psychology, Spiral Dynamics, psychic energy, geopolitics, economic trends, horticulture, enlightenment, travel, public health, languages, space, personal development, technology, cooking, and international relations.\nWriting/reading: I like to journal and read. I was a voracious reader as a child, and still read many books per year, but not as many as before. I usually read several articles per day on various topics (see other interests above). I would love to read books together and talk about them. I’ve written a book and plan to write more.\n\n\n\nRelationship and Attachment Styles: \n\nI have a generally positive outlook and a secure attachment style, which I have cultivated over time.\nI would love to enter a long-term partnership with someone who is as interested in ongoing learning, personal growth, and relationship development.\nI have experienced healthy ENM and relationships, and long-term monogamous ones. I could go in either direction. Whatever style we choose, I will honor it.\nOther quirks and random facts:\nI like round geometric patterns, quiet spaces, and find moss soothing. \nI was a featured artist at a poetry festival and part of an arts collective. \nI’ve visited over 36 active volcanoes. \nI pet a cheetah once. It rumbled like a lawnmower when it purred.\nI’ve travelled solo in Asia, Central and South America, and Africa – but I much prefer travelling with people.  \nI like to sing but am a bit shy about it.\n*\nWith some of my extended family, 10 years ago. (I’m 3rd from the right.)\n\n\n\nPersonality Tests\nMeyers-Briggs: INFP (More rarely, INTP.)\nEnneagram 9 w 8: I find the internet’s description of 9s generally unsatisfying. But these quotes from Personality Types by Riso and Hudson describe where I am on the developmental scale of type 9 (on good days): \n“...healthy people of this subtype give the impression of strength and good nature, sensuality, and power.” p371\n“...very healthy Nines are an example to all the personality types of what it means to be at one with the self and at one with the world. They are an example of the profound unity which is possible for human beings – the unity of the self as well as the unity of the self and the other. They teach us of a self-possession and self-surrender so profound as to have mystical overtones. They are so effortlessly themselves and so completely receptive that very healthy Nines must reflect what human beings were like before the Fall into self-consciousness and alienation. They are a living reminder that, when all is said and done, we are each a gift to the other, just as the other is a gift to us. To be completely ourselves and yet fully related to the other is a mystery to be surrendered to in silence.” p 348. \n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_lhs":1,"ds_fi":"kix.dfowj27kxoyx","ds_ulhfl":false,"ds_b":{"bg_c2":{"hclr_color":"#4305a6","clr_type":0}}}},{"ty":"ae","et":"list","id":"kix.1vwlgl6anlke","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"○","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"●","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":90.0,"b_gs":"■","b_a":0,"b_sn":1,"b_gt":9,"b_il":108.0},"nl_1":{"b_gf":"%1","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":1 on-dual consciousness and enlightenment. It’s not all roses (or lotuses) by any stretch of the imagination, but there’s a fundamental brilliance, ecstasy, joy, and love that bleeds through into everything in my world - even the hard stuff.\nDevelopmental Stage: somewhere between Transcendent Consciousness and Unity Consciousness. Jenny Wade wrote one of my favorite books, Changes of Mind, a Holonomic Theory of the Evolution of Consciousness. \nIn her phrasing, I spend a lot of time in Unity Consciousness. This is a stage of experiencing self as One with all things manifest and unmanifest, accessing multiple dimensions of spiritual and psychic phenomena everyday concurrent with material “reality.”\nI also operate within the stage below it, Transcendent Consciousness, a stage of dissolution of ego, and increasing identification with all that is. Global range, holistic thinking, morphogenetic fields, and solving problems with a combination of data and intuition.\nIn Suzanne Cook-Greuter\u0027s stages of ego development, I occupy Unitive Stage 6. You can read about it on pages 86 - 90 of her article here.\nSpiral Dynamics: Yellow, Turquoise, Coral (?) - see charts below for a summary of my world views. While I understand all the First Tier vMemes, and enjoy Yellow, I particularly love spending time with others who operate in the Turquoise to Coral ranges.*\nSource: http://www.calresco.org/wp/spiral.htm\n\n\n\n\n\n\n\n\n\n\n\n\n\nThis chart below has only Yellow and Turquoise. Coral is not depicted on this chart. \n*\nSource and full chart here: https://www.flickr.com/photos/kentbye/288326085/in/photostream/ \nIf you want to do a deeper dive into these topics (which I find super interesting) you can read a more in-depth overview of Yellow’s nested hierarchies of complexity and systems thinking.\nAnd you can find out more about Turquoise’s holographic integration of life and self, technology and feelings, science and spirit.\nAs for Coral/Indigo, I couldn’t find an in-depth written description that I liked online, but here is a video with a great overview. \nThese are the spaces where I most often live.\n\nMy Spiritual World – flowing between duality and non-duality (Oneness)\nAnd here’s the spiritual part of what I’m up to. It’s a huge part of my life path, so it gets its own section. I don’t need you to have a religion at all, and I won’t pressure you to be where I am with it, but I do need you to respect that I experience the world as a mystic, and it would be neat if you enjoy listening to me talk about it..\nI am very psychic (clairvoyant, clairaudient, clairsentient, precognitive). \nI perceive the Light and Love that exists within all things. \nSometimes I play with the light of the world, dancing with the flow of events in the downward current of manifestation at the intersection of dreams and reality. \nWithin this flow, I often perceive things before they happen, and can sometimes shape the way they unfold.\nRight now there’s always a constant awareness of that infinite light, but I go back and forth between experiencing myself as utterly one with it, nothing of my personality there, and then back to experiencing myself as Serena-who-is-one-with-everything. So, still somewhat separate from it, or existing as a smaller self within that greater Self. But more and more, that distinction between self and Self is disappearing, or seems unimportant. Occasionally I experience that there is no difference.\nMy awareness spans multiple dimensions, space-time, other worlds. I can perceive and communicate with entities in these spaces across a large range of energy frequencies. \nMinor miracles and uncanny coincidences are frequent events in my world. The improbable is probable in my life. \n"},{"ty":"ae","et":"positioned","id":"kix.a8d43g1hnrb9","epm":{"pe_lo":171.0,"pe_l":0,"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":378.6687099999999,"eo_rtdf":{"rdf_ft":0},"eo 156,"sm":{"ts_bd_i":true}},{"ty":"as","st":"text","si":7228,"ei":8762,"sm":{"ts_bd_i":true}}],"revision":27749}; DOCS_modelChunkLoadStart = new Date().getTime(); DOCS_initialLoadTiming.incrementTime('mp', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_modelChunk = {"chunk":[{"ty":"is","ibi":8763,"s":"I do energy healing work with friends and clients, mainly around energy psychology, spiritual development, trauma recovery, personal growth, clearing or upgrading energy anatomy, soul retrieval, past lives, future paths, and getting unstuck. \nI also attend to large scale things like clearing the traumatic residue of war, collaborating with friends to avert planetary destruction, helping to anchor divine light to aid large groups of people in leveling-up their state of consciousness and accelerate their spiritual awakening, or helping souls cross over after mass deaths.\nI also help staff a largish annual ceremony that sustains attendees’ annual personal development goals with an energy community in the Bay Area of California. A colleague and I are responsible for dreaming in the energies needed for the ceremony and helping to ground those energies into reality to help “juice” participants\u0027 future life changes. My intention is to support the personal awakening and growth of as many people as possible, so that we may change the world for the better. \n\nWhat are my flaws? Well, it depends on how you think of them, and I am generally kind to myself about them, but I can see how one or more of these would be deal breakers for some.\nChronic health conditions: I have a well-managed autoimmune disorder (currently in full remission, expected lifespan \u003d normal). Perimenopause is a challenge at the moment (insomnia, migraines), but HRT is helping. My current physical pace is slow and steady, except for having fast reflexes. If you want a partner to go running with you, I’m sorry, that is not me. We could go for walks though. I would love to walk and talk in beautiful places. I like gentle kayaking too. We could also do weight training, or tai chi. I’m open to finding some mild to moderate physical exercise we could do together. \nKeto: I’m a pretty good cook but I’ve been doing a keto-ish diet for migraines called the Stanton Migraine Protocol, so food is very low carb these days, with no sugars, so if you want to share a stack of wheat pancakes or to have a vegan partner, that is not me. (I was a raw vegan for a while, but it was too destructive for my particular physiology.) I’ve lost about 15 lbs so far and am more active than I was last year. It’s helping with the migraines too.\nHousekeeping, maintenance, and organization: With my health stuff, I tend to focus more on work, social time, relaxing, and spiritual things when I’m feeling well, so I am less good at these things, and pay someone to help me. But if I have someone doing chores with me, I’m happy to chat and clean, or do projects together. \nI can be stubborn – but this also makes me persistent, dedicated, and diligent. Mostly I am flexible and adaptable, but there are certain areas where I am immovable, usually having to do with deeply held values.\nMental health: While generally happy and in good spirits, I struggled with depression and anxiety for a long time. The inflammation from the autoimmune disorder made it hard to maintain beneficial neurotransmitters. But now that the inflammation is controlled, my mental health is generally good, well managed and regulated, though I admit the current metacrisis was wreaking some havoc until I decided to shift gears and be more active in addressing it (both the world’s problems and my own). I have a good support network. I have been doing my work independently and with a therapist and other healers for decades, and I’ve made a lot of progress, perhaps beyond the range of what is normal. I think almost everyone would benefit from having a therapist or expanded care team. Thankfully, I’m mostly on the other side of past trauma and it’s rare that occasional remnants come up now, and they are easily cleared. I have become far more resilient and joyful. So, I don’t think it would be an issue in a relationship, but I wanted you to know, because it also speaks to my approach to difficult life situations and ability to resolve them well.\nSpeed shifts: I can move slowly or quickly, depending on the circumstances. I will spend hours and hours researching and considering all the options. But when I decide it’s go-time, things can happen very quickly. It may look sudden, but it will generally be well-planned in advance over weeks or months, even years. These speed shifts can be disorienting if you’re someone who prefers an orderly life that rarely changs. \n"},{"ty":"ae","et":"list","id":"kix.fkkxz4vut8ed","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"○","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"●","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf":" OCS_initialLoadTiming.incrementTime('mp', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="NHWau1d1vKz6maKS16vR4w">DOCS_modelChunk = {"chunk":[{"ty":"is","ibi":13180,"s":"\nLanguages \nI like languages. I just like to swim around, enjoying the Sprachgefühl, so I’m not fluent in most.\nEnglish - fluent\nSpanish - nearly fluent\nBikol - moderately proficient\nTagalog - very basic\nBahasa - a little - I can sing a song!\nGerman - 1 year in college\nFrench - a bit, from watching movies\nKorean - many basic phrases, from watching k-dramas\nJapanese - a smidgeon\nMandarin - a teensy bit, mostly tai chi terms\n\nMy Professional World: \nMy professional reality is fairly mundane but kinda neat – I’m a middle manager of staff and operations for various humanitarian STEM projects and organizations, national and multinational. I got my start in this area as an executive assistant, where my skills often led to increasing management of operations and programs. Some have included things like green chemistry, next generation computing, non-linear electro-optics, biotechnology, sustainable agriculture, biofortification, genomics, space, medicine, and AI. I like the big picture. I also like details. I’ve worked in the non-profit, academic, and philanthropic sectors, and on public-private partnerships. I’ve co-managed a portfolio of international projects aimed at alleviating large scale poverty, the effects of climate change, and deaths from micronutrient deficiencies in the Global South. These days my job is smaller and more local, more routine and simple, which leaves me more time for hobbies, spiritual practices, and relationships. \n\nMore pictures:\n\n*\nAt my favorite tai chi event.\n*\nAt Fuego volcano, Guatemala, Feb. 2024. It’s currently erupting!\n*\nLeaning against a really cool basalt column / Torii gate, 2023.\n\n\n\nContact Info\nYou can email me at serenelotus75 [ a t ] gmail [ d o t ] com. Please tell me about yourself, what you’re looking for, and where you think we might (or might not) align for dating. Or just say hi if you’re curious about anything here. Feel free to send me your date-me doc link if you have one. Thanks, I look forward to connecting!\n\nAnd if I’m not your cup of tea, but you know someone who might be, please feel free to share this document with them. All the best, and I hope you have a wonderful life!"},{"ty":"is","ibi":15343,"s":"\u0003\n"},{"ty":"ae","et":"inline","id":"kix.3dbin9lyz17i","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":375.0,"eo_rtdf":{"rdf_ft":0},"eo_ml":9.0,"eo_mr":9.0,"eo_ad":null,"i_cid":"s-blob-v1-IMAGE-Ngn0y58SVNk","i_cont":0.0,"eo_mt":9.0,"eo_type":0,"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":"","lc_srk":""},"i_wth":375.0,"eo_at":null,"i_iwc":{"iwc_w":false},"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_iw":false,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"i_bri":0.0,"i_msct":0,"i_src":"","i_opa":1.0}}},{"ty":"ae","et":"inline","id":"kix.3he6fkm7l9y","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":624.0,"eo_rtdf":{"rdf_ft":0},"eo_ml":9.0,"eo_mr":9.0,"eo_ad":null,"i_cid":"s-blob-v1-IMAGE-3EafCfSynAI","i_cont":0.0,"eo_mt":9.0,"eo_type":0,"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":"","lc_srk":""},"i_wth":468.0,"eo_at":null,"i_iwc":{"iwc_w":false},"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_iw":false,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"i_bri":0.0,"i_msct":0,"i_src":"","i_opa":1.0}}},{"ty":"ae","et":"list","id":"kix.3ycida9hsuff","epm":{"le_nb":
